package com.scdevteam;

import java.util.Random;

public class Banners {
    private static final String[] FRANK = new String[] {
            "",
            "",
            "",
            "",
            "",
    };

    private static final String[] PINOCCHIO = new String[] {
            "",
            "",
            "",
            "",
            "",
            ""
    };

    static String[] getBanner() {
        Random r = new Random();
        int i = r.nextInt();
        return i % 2 == 0 ? FRANK : PINOCCHIO;
    }
}
